 'message': 'Move oppositeNode() from Graphs to Endpoints and rename it otherNode(). Also make a few methods final. It changes the following code:

Graphs.oppositeNode(graph, edge, node);

to this:

graph.incidentNodes(edge).otherNode(node);

The oppositeNode() method in Graphs always kind of bugged me. It takes three parameters, which is a lot for a utility method. More importantly, the last two parameters were both of type Object, with no "obviously correct" ordering, so it was easy to accidentally swap them and get a run-time error. Finally, with the introduction of the Endpoints class, this moves the method to the more logically correct place. Someone looking for this method was probably already dealing with incidentNodes() and Endpoints. It makes a lot more sense to say "hey, sorry you can't call target() since this is undirected, try otherNode() instead!" if it's in the same class.

In terms of the change itself, the more fluent style seems like a big win. And there's not even a burden to third-party implementations of Graph/Network, because we will have the only implementations of Endpoints (the constructor is private). So I see only positives and no negatives for this change.
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=126859221
'}

 'message': 'An optimization for Graphs and Networks, inspired by Michael. Introduce "MapIteratorCache" and "MapRetrievalCache". MapIteratorCache is extremely light-weight and optimizes the follow case:

for (N node : graph.nodes()) {
  graph.foo(node);
}

while MapRetrievalCache is slightly heavier and additionally optimizes the following cases:

graph.foo(node);
graph.bar(node);

OR

graph.foo(node1);
graph.foo(node2);
graph.bar(node1);
graph.bar(node2);
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=126763076
'}

 'message': 'Prevent fail() from being ignored by the surrounding catch() block by throwing new Error().

Tests of a testing API often look like this:

try {
  runATestThatShouldFail();
  fail();
} catch (AssertionError expected) {
}

However, the catch() block can catch not only the expected failure from runATestThatShouldFail() but also the "test did not fail when it should have" failure from fail().

This an automated fix using Error Prone ([]

We intend to make this a compilation error in []'s Java compiler,
so it is necessary to fix existing occurrences first to avoid breaking
builds.
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=116458330
'}

 'message': 'Add overloads to Preconditions checkState,checkArgument and checkNotNull to avoid boxing and varargs for the most common parameter combinations.

This adds primitive overloads for all combinations of Object,char,int and long up to 2 parameters and Object only overloads up to 4 parameters.  This covers 92-98% of formatting calls based on an analysis of googles codebase.

This change is fully binary compatible but only mostly source compatible.  It is possible that this cl will call some Preconditions calls to become ambiguous with respect to overload resolution.  For example this call

void foo(Boolean condition, short s) {
  checkState(condition, "%s", s);
}

will fail to compile with this change.  There are two simple changes to the invocation that will resolve the ambiguity.  'condition' can be explicitly unboxed, or 's' can be explicitly boxed.  We believe that such situations will be incredibly rare.

See the JLS 15.12.2 for full information on overload resolution: https://docs.oracle.com/javase/specs/jls/se7/html/jls-15.html#jls-15.12.2
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=115881707
'}

 'message': "Fix 6-year-old test bug.

The bug is:

  try {
    somethingThatShouldFail();
    fail();
  } catch (AssertionFailedError expected) {
  }

The fail() is masked by the catch() block.
I've requested an enhancement to Error Prone to catch this: https://github.com/google/error-prone/issues/393

Additionally, I improved IteratorTester under GWT: IteratorTester couldn't catch wrong-exception bugs there because of GWT's lack of reflection. This was a known, documented limitation, but the tests still attempted to verify its ability to do so. When I fixed the test bug, they broke. I then realized that I could just fix IteratorTester to work under GWT. It's probably even a simplification.

Tested:
global TAP
[]
-------------
Created by MOE: https://github.com/google/moe
MOE_MIGRATED_REVID=115380685
